tINT KSHj2HgComp( tHCHAR *Hj, HANJA_TABLE *KSHanjaTable );

tINT KSHj2HgComp( tHCHAR *Hj, HANJA_TABLE *KSHanjaTable )
{
	return (tINT)(*Hj - KSHanjaTable->Hj);
}


tHCHAR KSHj2HgH( tHCHAR Hj )
{
        HANJA_TABLE *p;

        p = (HANJA_TABLE *)bsearch(&Hj, KSHanjaTable, COUNT_HANJA, sizeof(HANJA_TABLE), (CompProcP)KSHj2HgComp);
        if(p == NULL) {
                return(Hj);
        }
	else {
                return(p->Hg);
        }
}


tBOOL KSHjHStr2HgHStr( tHCHAR *HjStr, tHCHAR *HgStr )
{
        tINT i;
        tBOOL bRetVal = FALSE;

        for(i = 0; i < HStrlen(HjStr); i++) {
                if( HjStr[i]>= 0xcaa1 && HjStr[i] <= 0xfdfe) {
                        bRetVal = TRUE;
                        HgStr[i] = KSHj2HgH(HjStr[i]);
                }else {
                        HgStr[i] = HjStr[i];
                }
        }
	HgStr[i] = 0x00;
        return(bRetVal);
}

